import React, { useState, useEffect } from 'react';
import { Link, useNavigate, useLocation, useParams } from 'react-router-dom';

function Add() {
    const navigate = useNavigate();
    // const location = useLocation();
    const [client, setClient] = useState({});

    // useEffect(() => {
    //     setProduct(location.state);
    //     getCategories();
    // }, []);

    const act = 'add';

    const setInputs = (event) => {
        const temp = client;
        temp[event.target.id] = event.target.value;
        console.log(temp);
        setClient(temp);
    }

    const click = async() => {
        // const data = 
        await fetch(`http://localhost:3090/clients/add`, {
            method: 'POST',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({ client: client })
        });
        navigate(-1);
    }

    return ( <
        div className = 'container' >
        <
        h3 onClick = {
            () => { navigate(-1); } } > X < /h3> <
        div >
        <
        h1 className = 'form_title' > Ad Client < /h1> <
        div className = 'form_input-group' >
        <
        input type = 'text'
        className = 'form_input'
        id = 'firstName'
        onBlur = { setInputs }
        placeholder = 'First Name' /*{client.firstName}*/ / >
        <
        /div> <
        div className = 'form_input-group' >
        <
        input type = 'text'
        className = 'form_input'
        id = 'lastName'
        onBlur = { setInputs }
        placeholder = 'Last Name' /*{client.firstName}*/ / >
        <
        /div> <
        div className = 'form_input-group' >
        <
        input type = 'text'
        className = 'form_input'
        id = 'clientId'
        onBlur = { setInputs }
        placeholder = 'Id' /*{client.firstName}*/ / >
        <
        /div> <
        div className = 'form_input-group' >
        <
        span > Date Of Birth < /span> <
        input type = 'date'
        className = 'form_input'
        id = 'dateOfBirth'
        onBlur = { setInputs }
        placeholder = 'Date Of Birth' /*{client.firstName}*/ / >
        <
        /div> <
        div className = 'form_input-group' >
        <
        input type = 'text'
        className = 'form_input'
        id = 'telphone'
        onBlur = { setInputs }
        placeholder = 'Telephone' /*{client.firstName}*/ / >
        <
        /div> <
        div className = 'form_input-group' >
        <
        input type = 'text'
        className = 'form_input'
        id = 'phone'
        onBlur = { setInputs }
        placeholder = 'Phone' /*{client.firstName}*/ / >
        <
        /div> <
        div className = 'form_input-group' >
        <
        input type = 'text'
        className = 'form_input'
        id = 'telephone'
        onBlur = { setInputs }
        placeholder = 'Telephone' /*{client.firstName}*/ / >
        <
        /div> <
        button className = 'form_button'
        type = 'submit'
        onClick = { click } > { act } < /button> <
        /div> <
        /div>
    )
}

export default Add;
